import React from 'react';
import styled from '@emotion/styled'

const Core = styled.div `
  position: relative;
  top: 100vh;
  width: 100%;
  background: white;
  border-radius: 40px;
  margin: auto;
  overflow: visible;

  min-width: 650px;
  max-width: 650px;

  height: 2000px;
`;
const Header = styled.div `

`;

function Body() {
  return (
    <Core>
      <div>
        <Header>who am i?</Header>
      </div>
    </Core>
  );
}

export default Body;
